import styles from './ReportForm.module.css'
//表单处理
import { useForm, SubmitHandler } from "react-hook-form"
import EventIcon from '@material-ui/icons/Event';
import { FormControl, FormLabel, RadioGroup, FormControlLabel, TextField, InputLabel, Input, IconButton, InputAdornment } from '@material-ui/core';
import Radio from '@material-ui/core/Radio';
import { Visibility, VisibilityOff } from '@material-ui/icons';
import { Form } from 'antd';

import React, { useState } from 'react';
import { projectInfos, medicineInfos, IFormInput, TextFieldInfo, ActionTypeEnum, OtherOptionEnum } from './data';
import { request } from 'http';



function ReportForm({ open, onCancel }: { open: boolean, onCancel: any }) {
    return (
        <div onClick={onCancel} className={styles.box} style={{ display: open ? 'block' : 'none' }}>
            <div onClick={(e) => { e.stopPropagation() }} className={styles.contentBox}>
                <FormDisabledDemo />
            </div>
        </div>
    )
}

export default ReportForm;


const FormDisabledDemo: React.FC = () => {

    const [actionType, setActionType] = useState("1");
    const { register, handleSubmit } = useForm<IFormInput>();

    const onSubmit: SubmitHandler<IFormInput> = (data) => {
        console.log("onSubmit==", data)
    }
    //自定义输入框需要记录值
    const [values, setValues] = React.useState({
        //安全信息接收日期
        infoGetDate: '2022/09/08',
        //有效日期
        validDate: '',
        //疾病类型
        diseaseType: '',
        //使用剂量
        DOSAGER: '',
        //批号
        lotNumber: ''
    });
    //自定义输入框事件处理
    const [tfAction, setTfAction] = React.useState({
        //是否展示安全信息接收日期选择日历
        isShowCalendar1: false,
        //是否展示有效日期选择日历
        isShowValidDateCalendar: false,
        //有效日期不详?
        validDateUnknown: false,
        //疾病类型不详?
        diseaseTypeUnknown: false,
        //使用剂量不详?
        DOSAGERUnknown: false,
        //批号不详?
        lotNumberUnknown: false

    })




    const projectTFs =
        (
            <>
                {/*  */}
                <TextField
                    color="secondary"
                    id={projectInfos["infoReceiveDate"].id}
                    label={projectInfos["infoReceiveDate"].label}
                    type="date"
                    defaultValue="2022-05-24"
                    style={{ ...{ width: projectInfos["infoReceiveDate"].width }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
                <TextField
                    {...register("orgName",
                    { required: true })}                
                    required
                    style={{ ...{ width: projectInfos["orgName"].id }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id={projectInfos["orgName"].id}
                    label={<div style={{ fontSize: 13, float: 'left' }}>{projectInfos["orgName"].label}</div>}
                    defaultValue={projectInfos["orgName"].defaultValue}
                />
                <TextField
                    {...register("reporterNo",
                    { required: true })}                
                    required
                    style={{ ...{ width: projectInfos["reporterNo"].id }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id={projectInfos["reporterNo"].id}
                    label={<div style={{ fontSize: 13, float: 'left' }}>{projectInfos["reporterNo"].label}</div>}
                    defaultValue={projectInfos["reporterNo"].defaultValue}
                />
                <TextField
                    {...register("orgAddress",
                    { required: true })}                
                    required
                    style={{ ...{ width: projectInfos["orgAddress"].id }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id={projectInfos["orgAddress"].id}
                    label={<div style={{ fontSize: 13, float: 'left' }}>{projectInfos["orgAddress"].label}</div>}
                    defaultValue={projectInfos["orgAddress"].defaultValue}
                />
                <TextField
                    {...register("itemNumber",
                    { required: true })}                
                    required
                    style={{ ...{ width: projectInfos["itemNumber"].id }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id={projectInfos["itemNumber"].id}
                    label={<div style={{ fontSize: 13, float: 'left' }}>{projectInfos["itemNumber"].label}</div>}
                    defaultValue={projectInfos["itemNumber"].defaultValue}
                />
                <TextField
                    {...register("WISECode",
                    { required: true })}                
                    required
                    style={{ ...{ width: projectInfos["WISECode"].id }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id={projectInfos["WISECode"].id}
                    label={<div style={{ fontSize: 13, float: 'left' }}>{projectInfos["WISECode"].label}</div>}
                    defaultValue={projectInfos["WISECode"].defaultValue}
                />
                <TextField
                    {...register("orgTel",
                    { required: true })}                
                    required
                    style={{ ...{ width: projectInfos["orgTel"].id }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id={projectInfos["orgTel"].id}
                    label={<div style={{ fontSize: 13, float: 'left' }}>{projectInfos["orgTel"].label}</div>}
                    defaultValue={projectInfos["orgTel"].defaultValue}
                />
                <TextField
                    {...register("ChimAERa",
                    { required: true })}                
                    required
                    style={{ ...{ width: projectInfos["ChimAERa"].id }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id={projectInfos["ChimAERa"].id}
                    label={<div style={{ fontSize: 13, float: 'left' }}>{projectInfos["ChimAERa"].label}</div>}
                    defaultValue={projectInfos["ChimAERa"].defaultValue}
                />
                <TextField
                    {...register("orgEmail",
                    { required: true })}                
                    required
